import React from 'react'

export default function Header() {
  return (
    <nav>
      <ul>
        <li><h1>Ifa Brand</h1></li>
        <li>Work</li>
        <li>Shop</li>
        <li>Contact</li>
      </ul>
      <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }

        ul {
          display: flex;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        h1 {
          font-size: 30px;
          margin-right: 40px;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </nav>
  )
}
